-- ----------------------------
-- Table structure for club
-- ----------------------------
DROP TABLE IF EXISTS `club`;
CREATE TABLE `club` (
  `club_number` int(11) NOT NULL,
  `club_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '俱乐部名称',
  `description` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '俱乐部简介',
  `college_id` int(11) NOT NULL COMMENT '负责学院',
  `StudentCount` int(2) DEFAULT NULL COMMENT '会员人数',
  `founded_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '成立时间',
  PRIMARY KEY (`club_number`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=DYNAMIC;

