-- ----------------------------
-- Table structure for student_club
-- ----------------------------
DROP TABLE IF EXISTS `student_club`;
CREATE TABLE `student_club` (
  `student_number` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '学号',
  `club_number` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '俱乐部编号',
  `score` int(11) DEFAULT NULL COMMENT '社团考核成绩',
  `status` tinyint(1) DEFAULT '1' COMMENT '俱乐部成员状态：1--正常；2--已经退社',
  `enroll_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '加入时间'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=DYNAMIC;

