-- ----------------------------
-- Procedure structure for sp_test_update_clubID
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_test_update_clubID`;
DELIMITER ;;
CREATE DEFINER=`ncepu_ideal`@`%` PROCEDURE `sp_test_update_clubID`()
begin
# 声明自定义变量
DECLARE temp_student_id varchar(12);

# 声明游标结束变量
DECLARE done INT DEFAULT 0;

# 声明游标 cr 以及游标读取到结果集最后的处理方式
DECLARE cur CURSOR FOR SELECT student_number FROM student_club;
DECLARE continue handler for not found set done = 1;

# 打开游标
OPEN cur;
# 循环
  users_loop: LOOP
	   # 定义一个变量作为随机取值
		 
		 # set @rand_student_id = '';
     # select @rand_student_id:=student_id from FROM `student` Limit 1;
		 
		 # declare rand_student_id varchar(12);
		 # select student_id into rand_student_id from `student ORDER BY RAND() LIMIT 1;
		 
		 # select @rand_student_number:= student_number FROM `student` Order  By  rand()  Limit 1;		 
		 
     # 获取游标中值并赋值给变量
     FETCH cur INTO temp_student_id;
     # 判断游标是否到底，若到底则退出游标
     # 需要注意这个判断
     IF done=1 THEN
         LEAVE users_loop;
     END IF;
     # 需要执行的语句
     update student_club set club_number = (select club_number FROM `club` Order  By  rand()  Limit 1) WHERE student_number = temp_student_id;
  END LOOP users_loop;
-- 关闭游标
CLOSE cur;
end
;;
DELIMITER ;

